    //     }, 30000)
    //   }, [])
    return(
        <>
        <div className="two">
        <Left path="#slide1"></Left>
            <Right path="#slide3"></Right>
            <center>
                {/* first text starts */}
           <h2 className="second text-4xl">2023 was a Feast for Your<br></br> Brains and Fingers</h2>
           <p>You Created {props.repo} Repositories This Year</p>
            </center>
       
        </div>
        
        </>
    )
}
export default Two;
